import React from "react";
import Navbar from "./Navbar";

export default function Home() {
  return (
    <div className="hero">
      <div className="card text-bg-dark ">
        <img src="https://img.freepik.com/free-photo/black-friday-elements-assortment_23-2149074076.jpg?w=1380&t=st=1668320797~exp=1668321397~hmac=d91a40a51290f4d2e683f17e8f469f0c58c54713be10549522b05fb9b99a05dd" className="card-img" alt="Background" />
        <div className="card-img-overlay">
          <h5 className="card-title">Card title</h5>
          <p className="card-text">
            This is a wider card with supporting text below as a natural lead-in
            to additional content. This content is a little bit longer.
          </p>
          <p className="card-text">
            <small>Last updated 3 mins ago</small>
          </p>
        </div>
      </div>
    </div>
  );
}
